import { Component } from 'react';
import { Route, Switch } from 'react-router';
import './App.css';
import Home from './Home';


class App extends Component {
    render() {
      return (
          <div className="app">
            <Switch>
              <Route>
                <Home />
              </Route>
              <Route>
                <Login />
              </Route>
              <Route>
                <Home />
              </Route>
            </Switch>

          </div>
      );
    }
}

export default App;
